import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function MyRouter(props) {
    return (
        <Router>
            <Switch>
                <Route path="/login">
                    <Login />
                </Route>
                <Route path="/register">
                    <Register />
                </Route>
                <Route path="/home">
                    <NewsFeed user={props.user} />
                </Route>
                {/* <Route path="/profile">
                    <Dial />
                </Route> */}
                <Route path="/">
                    <Login />
                </Route>
            </Switch>
        </Router>
    );
}

export default MyRouter;
